description:
The Swingers 2 (2013)

John is a regular player in the local swinger scene. It's an important
part of his life that he tries to share with the women he meets. When he
meets Jane, he's head-over-heels, and becomes conflicted whether to
introduce her to his swinging lifestyle or give it up for good. Will his
innocent younger brother Gary steer him in the right direction or help
Jane accept John's lifestyle choices instead? Sweet Sinner brings you
back into the lustful world of swingers, where the passions of the body
and the desires of the heart should never cross!

Asa Akira, Erik Everhard, Dane Cross, Lea Lexis, Holly Taylor,
Tyler Nixon

Hardcore, All Sex

